$.fn.positionOn = function (element, align) {
    return this.each(function () {
        var target = $(this);
        var position = element.position();

        var x = position.left;
        var y = position.top;

        if (align == 'right') {
            x -= (target.outerWidth() - element.outerWidth());
            y -= (target.outerHeight() - element.outerHeight());
        } else if (align == 'center') {
            x -= target.outerWidth() / 2 - element.outerWidth() / 2;
            y -= 10 + target.outerHeight() - element.outerHeight();
        }

        target.css({
            position:'absolute',
            zIndex:5000,
            top:y,
            left:x
        });
    });
};

(function ($) {
    jQuery.fn.jConfirmAction = function (options) {

        var theOptions = jQuery.extend({
            question:"Are You Sure ?",
            yesAnswer:"Yes",
            cancelAnswer:"Cancel",
            callback:false
        }, options);

        return this.each(function () {
            thisHref = $(this).attr('href');

            if ($(this).next('.question').length <= 0) {
                $(this).after('<div class="question">' + theOptions.question + '<br/> <span class="yes">' + theOptions.yesAnswer + '</span><span class="cancel-confirm">' + theOptions.cancelAnswer + '</span></div>');
            }

            $(this).next('.question').positionOn($(this), 'center');

            $(this).next('.question').animate({opacity:1}, 300);

            $('.yes').bind('click', function () {
                if (typeof theOptions.callback == "function") {
                    theOptions.callback();
                    $(this).parents('.question').remove();
                } else {
                    window.location = thisHref;
                }
            });

            $('.cancel-confirm').live('click', function () {
                $(this).parents('.question').fadeOut(300, function () {
                    $(this).remove();
                });
            });
        });
    };
})(jQuery);
